Gonzo, All Sex
--------------

It was on Halloween night that a young Michael Myers inexplicably slaughtered his slutty older sister (Raven Alexis). Fifteen later, he escapes a mental hospital and returns home. Spotting a scholarly looking teenager, Laurie (Lily LaBeau), the deranged psychopath Michael lusts after her and stalks her. Finding her trampy friends, Annie (Andy San Dimas) and Lynda (Lexi Belle) engaging in carnal acts with their boyfriends on Halloween eve, just as his sister did years ago, sets Michael off. While her friends are off engaging in sex acts and getting killed, the responsible Laurie is at home babysitting. Unable to reach her friends by phone, Laurie becomes suspicious and walks across the street to Annie\\\\\\\'s darkened house and comes fact to face with Michael Myers himself.

